import AccessAlarmIcon from '@mui/icons-material/AccessAlarm';
import ReorderIcon from '@mui/icons-material/Reorder';
const Header = () => {
    return (
        <>
        <div className="header">hey
            <div className="header_left">
            <AccessAlarmIcon />
            <ReorderIcon />
            <img src='https://duet-cdn.vox-cdn.com/thumbor/0x0:1320x880/640x427/filters:focal(660x440:661x441):format(webp)/cdn.vox-cdn.com/uploads/chorus_asset/file/21939811/newgmaillogo.jpg' alt='logo' ></img>
            </div>
        </div>
        </>
    )
};

export default Header;
